Cette démarche simplifiée vous permet de déposer votre demande de 1er titre de séjour car vous résidez sur une commune située sur l'arrondissement de Meaux et vous êtes dans l'une des situations suivantes :

    - mineur devenu majeur entré avant l’âge de 13 ans, ou 10 ans si vous êtes de nationalité algérienne ou tunisienne ;

    - muni d’un visa « D » mention carte de séjour à solliciter sous deux mois ; (portant la mention stagiaire, regroupement familial)

    - ressortissant britannique bénéficiaires de l’accord de retrait du Royaume-Uni de l’UE ;

   - membre de famille d’un ressortissant britannique bénéficiaire de l’accord de retrait du Royaume-Uni de l’UE ;

Pour connaître les communes rattachées à la sous-préfecture de Meaux :

http://www.seine-et-marne.gouv.fr/Demarches-administratives/De-quelle-prefecture-ou-sous-prefecture-je-depends

