Vous devez scanner et ajouter la copie de votre passeport dont obligatoirement : 

1/  le visa d'entrée en France si vous en possédez un ;

2/  la page de votre état civil ;

3/  le cachet d'entrée en France.

Vous devez scanner et ajouter la copie de votre justificatif de domicile datant de moins de 6 mois à votre nom et prénom : 

o	facture d’électricité, gaz, eau, téléphone fixe, accès à internet, quittance de loyer,bail de location,  ou taxe d’habitation  ;

o	en cas d’hébergement chez un particulier : 

			- attestation d’hébergement datée et signée par l'hébergeant ;
			- copie de la carte d’identité ou de la carte de séjour de l'hébergeant ;
			- facture d’électricité, gaz, eau, téléphone fixe, accès à internet ou loyer de 	l’hébergeant datée de – de 6 mois ;
